import React, { useState, useEffect } from "react";
import axios from "axios";
import Button from "@mui/material/Button";
import Tooltip from "@mui/material/Tooltip";

import '../styles/ImageFetching.css'


const ImageFetching = () => {
  const [imageTitle, setImageTitle] = useState([]);

  useEffect(() => {
    axios
      .get("http://localhost:5001/HomeImages")
      .then((res) => {
        setImageTitle(res.data);
      })
      .catch((error) => {
        console.error("Error fetching courses:", error);
      });
  }, []);
 

  return (
    <div>
      <h1>Images</h1>
      {/* {imageTitle.map((imageName) => (
        <p key={imageName.images_id}>{imageName.image_title}</p>
      ))} */}

      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Images</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {imageTitle.map((imageName) => (
            <tr key={imageName.images_id}>
              <td>{imageName.images_id}</td>
              <td>{imageName.image_title}</td>
              <td className="action">
                <Tooltip title="Delete" arrow>
                  <Button>
                    <span className="material-symbols-outlined">delete</span>{" "}
                  </Button>
                </Tooltip>
                <Tooltip title="Update" arrow>
                  <Button>
                    <span className="material-symbols-outlined">update</span>{" "}
                  </Button>
                </Tooltip>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default ImageFetching;
